template.filter:
if ($node == null or not $node->isSNMP)
	return false;
if ($node->snmpOID == "1.3.6.1.4.1.232.9.4.10" or $node->snmpOID == "1.3.6.1.4.1.232.9.4.11")
	return true;
if (lower($node->platformName[0:7]) == "windows")
{
	table = AgentReadTable($node, "System.InstalledProducts");
	if (table == null)
		return null;
	colName = table->getColumnIndex("Name");
	for (currentRow = 0; currentRow < table->rowCount; currentRow++)
	{
		name = table->get(currentRow, colName);
		if (name == "HP Insight Management Agents" or name == "HPE Insight Management Agents")
			return true;
	}
}
return false;
